import emailjs from "emailjs-com";

const Contact = ()=>{

    const formSubmit = (e)=>{
        e.preventDefault();
    }

    return(
        <div className="contact">
            <div className="description">
                <span>Contact Me,</span>
                <span>Nothing to say, just say hi</span>
            </div>
            <div className="mail">
                <div className="form">
                    <form onSubmit={formSubmit}>
                        <input type="text" placeholder="Your Name" name="senderName" />
                        <input type="email" placeholder="Your Email"  name="senderEmail"/>
                        <input type="message" placeholder="Atleast Say HELLO !!" name="senderMessage" rows="5" />
                        <button>Send</button>
                    </form>
                </div>
                <div className="socials"></div>
            </div>
        </div>
    );
}

export default Contact;
